import { useState, useEffect } from "react";
import { motion } from "framer-motion";
import { useNavigate } from "react-router-dom";

export default function Login() {
  const [telefon, setTelefon] = useState("");
  const [adminCode, setAdminCode] = useState("");
  const [error, setError] = useState("");
  const [loading, setLoading] = useState(false);
  const navigate = useNavigate();

  // ✅ Dacă e deja logat, redirecționează spre dashboard
  useEffect(() => {
    const savedUser =
      JSON.parse(localStorage.getItem("loggedUser")) ||
      JSON.parse(sessionStorage.getItem("loggedUser"));
    if (savedUser?.isAdmin) navigate("/dashboard");
  }, [navigate]);

  const handleLogin = async (e) => {
    e.preventDefault();
    setError("");
    setLoading(true);

    if (!telefon.trim() || !adminCode.trim()) {
      setError("Completează toate câmpurile!");
      setLoading(false);
      return;
    }

    try {
      const formData = new FormData();
      formData.append("telefon", telefon);
      formData.append("cod_acces", adminCode);

      const res = await fetch(
        "http://localhost/barbershop/frontend/backend/api/admin_login.php",
        { method: "POST", body: formData }
      );
      const data = await res.json();

      if (data.success && data.admin) {
        const adminUser = {
          id: data.admin.id,
          prenume: data.admin.prenume,
          nume: data.admin.nume,
          telefon: data.admin.telefon,
          isAdmin: true,
        };

        localStorage.setItem("loggedUser", JSON.stringify(adminUser));
        window.dispatchEvent(new Event("userUpdated"));

        alert(`✅ Bun venit, ${adminUser.prenume} (Admin)!`);
        navigate("/dashboard");
      } else {
        setError(data.error || "Date de autentificare invalide!");
      }
    } catch (err) {
      console.error("Eroare server:", err);
      setError("Eroare la conexiunea cu serverul.");
    } finally {
      setLoading(false);
    }
  };

  return (
    <section className="min-h-screen flex items-center justify-center bg-[#0f0f0f] text-white">
      <motion.div
        initial={{ opacity: 0, y: 40 }}
        animate={{ opacity: 1, y: 0 }}
        transition={{ duration: 0.6 }}
        className="bg-black/40 backdrop-blur-md border border-[#d4af37]/30 rounded-2xl p-10 w-full max-w-md shadow-lg"
      >
        <h2 className="text-3xl font-bold text-center text-[#d4af37] mb-6">
          Autentificare Admin
        </h2>

        <form onSubmit={handleLogin} className="space-y-6">
          {/* Telefon */}
          <div>
            <label className="block text-sm text-gray-300 mb-2">
              Număr de telefon
            </label>
            <input
              type="tel"
              value={telefon}
              onChange={(e) => setTelefon(e.target.value)}
              placeholder="+37360000000"
              className={`w-full bg-transparent border ${
                error
                  ? "border-red-500 focus:border-red-500"
                  : "border-[#d4af37]/30 focus:border-[#d4af37]"
              } text-white rounded-md px-4 py-2 focus:outline-none transition`}
            />
          </div>

          {/* Cod acces admin */}
          <div>
            <label className="block text-sm text-gray-300 mb-2">
              Cod de acces
            </label>
            <input
              type="password"
              value={adminCode}
              onChange={(e) => setAdminCode(e.target.value)}
              placeholder="Introdu codul secret"
              className={`w-full bg-transparent border ${
                error
                  ? "border-red-500 focus:border-red-500"
                  : "border-[#d4af37]/30 focus:border-[#d4af37]"
              } text-white rounded-md px-4 py-2 focus:outline-none transition`}
            />
          </div>

          {error && <p className="text-red-500 text-xs">{error}</p>}

          {/* Buton Login */}
          <motion.button
            whileHover={{ scale: 1.05 }}
            whileTap={{ scale: 0.95 }}
            type="submit"
            disabled={loading}
            className={`w-full mt-5 font-semibold py-3 rounded-md border border-[#d4af37] transition duration-300 ${
              loading
                ? "bg-gray-600 text-gray-300 cursor-not-allowed"
                : "bg-[#d4af37] text-black hover:bg-transparent hover:text-[#d4af37]"
            }`}
          >
            {loading ? "Se verifică..." : "Autentifică-te"}
          </motion.button>
        </form>

        <p className="text-center text-gray-400 text-xs mt-8">
          Accesul este permis doar administratorilor înregistrați.
        </p>
      </motion.div>
    </section>
  );
}
